import React from 'react';
import TeamData from '../static/team-page-info'; 
import Avatar from '@material-ui/core/Avatar'; 
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';



export default function TeamPage() {

  return (
    <div>
      <h1>Our Team</h1>
      <Grid container spacing={0} 
      alignItems="center"
      justify="center">          
        {TeamData.teamData.map((member) => (
          <Grid item xs={12} sm={3}>
            <Avatar src={member.image} style={{margin: "auto", width: "75%", height: "75%"}}></Avatar>
            <span style={{}}>{member.name}</span>
            <p style={{marginLeft: "10%", marginRight: "10%", textAlign: "left"}}>{member.bio}</p>
          </Grid>
        ))}
      </Grid>
    </div>

  );
}
